import './ProjectOne.css';

function ProjectOne() {
    return (
        <>
        <section className="work-header">
            <h1 className="work-header-text">
                <a href="https://www.javimusiq.com" target="_blank">javiMusiq</a>
            </h1>
        </section>
            
        </>
    )
}

export default ProjectOne;
